- input: "TEXT\x1CC00549295\x1C.TEXT\x1C\x1CF3N\x1CThis report is amended to correct
    data errors discovered in the prior report, provide additional FEC Required \"best
    efforts\" information obtained to date, and respond to the RFAI dated December
    3, 2013.  This report has also been mailed to the US Senate.  In response to item
    1 of this RFAI, this Committee exercises its best efforts to report the complete
    identification of all contributors who contribute in excess of $200 in a calendar
    year.  First, this Committee makes a clear and conspicuous request for this information
    on its website donation platform and on the standardized solicitation materials
    distributed to prospective contributors in advance of events and in other communications
    from fundraising personnel to prospective contributors.  Second, contributors
    who do not provide that information originally receive a subsequent request for
    that information through phone, email, or regular mail that is not itself a solicitation.
    \ Third, if and when that information is obtained after the filing of a report,
    the subject report will be amended.  In response to item 2 of this RFAI, this
    committed has amended this report to properly attribute contributions made to
    both the Primary and General elections.\n"
